  return (<img className ="image" key = {props.pokemonkey} alt='poke' src={`https://pokeres.bastionbot.org/images/pokemon/${props.pokemonkey}.png/`} 
		 onClick = {(e)=>props.clickFunction(e,props.pokemonkey)} onKeyPress={keyPress} />

		 )


}













export default Pic;
